"metaData":{
"desc":"Global REXYGEN HMI configuration component. User can change project options, configure the HTML export and define list of connections between REXYGEN target and HMI.",
"header_mode":{
"desc":"Change the default size of the header (thin, packed). If packed click on the logo to show the header.",
"order":"05",
"type":"enum",
"values":[
"",
"thin",
"pack-top-left",
"pack-top-right",
"pack-bottom-left",
"pack-bottom-right"
]
},
"kiosk_mode":{
"desc":"If True the links from header (from logo and header) are removed and user can not change the refresh rate and target.",
"order":"06",
"type":"bool"
},
"log_level":{
"desc":"Set the global log level for whole RexHMI. The log messages are written both to the right upper corner menu and to the web browser console. Default level is INFO.",
"order":"02",
"type":"enum",
"values":[
"",
"TRACE",
"DEBUG",
"INFO",
"WARN",
"ERROR"
]
},
"refresh_rate":{
"desc":"Changes the default read refresh rate of the whole HMI. Default 500ms",
"max":"300000",
"min":"20",
"order":"01",
"type":"int"
},
"show_clock":{
"desc":"If True the clock are shown in the right upper corner of the template instead of blinking square. If the target is connected the clock are updated if connection get error o lost the time stops.",
"order":"03",
"type":"bool"
},
"target_url":{
"desc":"The URL of the target device. So far only the WebSocket protocol is supported. The URL must also contain the PORT, but the protocol can be omitted. Default is empty string which means ws://127.0.0.1:8008 <br /> Examples: 192.168.1.100:8008 or wss://192.168.1.100:8009 <br /> <i> Note: If the HMI is hosted on the internal web server this option is ignored and HMI connects to the hostname / IP you use in the webbrowser URL.</i>",
"order":"07",
"prev":[
"ws_ip"
],
"type":"str"
},
"use_client_time":{
"desc":"If True the <code>show_clock</code> display the time from client computer rather then target. This can be use when target device does not have NTP synchronization or RTC chip.",
"order":"04",
"type":"bool"
}
},
"options":{
"header_mode":"",
"kiosk_mode":"False",
"log_level":"",
"refresh_rate":10,
"show_clock":"True",
"target_url":"",
"use_client_time":"False"
}
}

{
"connections":{
"disable_by":"",
"hide_by":"",
"value":"$T_value"
},
"metaData":{
"connections":{
"disable_by":{
"default":"",
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"default":"",
"desc":"If non-zero the component is hidden.",
"optional":true
},
"value":{
"default":"$T_value",
"desc":"Datapoint from which the value is read.",
"order":"01"
}
},
"desc":"Display component shows value from the target system as a string. It can be either <code>number</code>, <code>date</code>, <code>datetime</code> or simple value as a <code>text</code> string depending on the <code>format</code> property. Each display can have <code>units</code> which are shown at the end of the displayed string.",
"options":{
"color":{
"default":"#000000",
"desc":"Normal font color of the display. Applicable for <code>number</code> format only.",
"order":"06",
"type":"color"
},
"colorAbove":{
"default":"#df2626",
"desc":"Font color of the display when the read value is above <code>rangeMax</code>. Applicable for <code>number</code> format only.",
"order":"07",
"type":"color"
},
"colorBelow":{
"default":"#0074c5",
"desc":"Font color of the display when the read value is below <code>rangeMin</code>. Applicable for <code>number</code> format only.",
"order":"08",
"type":"color"
},
"decimals":{
"default":"2",
"desc":"Round the read value to defined number of decimals. Applicable for <code>number</code> format only.",
"max":"6",
"min":"0",
"order":"05",
"type":"int"
},
"format":{
"default":"number",
"desc":"<code>number</code> - If selected the read value is converted to the number either integer or float. Also the parameters <code>scale</code>,<code>offset</code> and <code>decimals</code> are applied during conversion. The color of the text depends on the <code>color</code> property if the value is higher than <code>rangeMax</code> the <code>colorAbove</code> is used likewise if the value is lower than  <code>rangeMin</code> the <code>colorBelow</code> is applied.<br /><code>time</code> and <code>datetime</code> - The display will convert read value in milliseconds from REXYGEN Epoch to the current time or datetime. The property <code>text_format</code> is applied in this context where the format of the displayed time can be selected.<br /><code>text</code> - Simple show the value in the format as was received. Suitable for short strings.",
"order":"01",
"type":"enum",
"values":[
"number",
"time",
"datetime",
"text"
]
},
"offset":{
"default":"0",
"desc":"Add some offset to the read value. Applicable for <code>number</code> format only.",
"order":"04",
"type":"float"
},
"rangeMax":{
"default":"10000",
"desc":"When the read value is above <code>rangeMax</code> the <code>colorAbove</code> color is applied to the font. Applicable for <code>number</code> format only.",
"order":"09",
"type":"float"
},
"rangeMin":{
"default":"-10000",
"desc":"When the read value is below <code>rangeMin</code> the <code>colorBelow</code> color is applied to the font. Applicable for <code>number</code> format only.",
"order":"10",
"type":"float"
},
"scale":{
"default":"1",
"desc":"Scale the read value. Applicable for <code>number</code> format only.",
"order":"03",
"type":"float"
},
"text_format":{
"default":"",
"desc":"Select the format of the time string for <code>time</code> and <code>datetime</code>.",
"order":"02",
"type":"enum",
"values":[
"",
"hh:mm:ss",
"hh:mm"
]
},
"units":{
"default":"",
"desc":"Append some string to the end of the displayed value. Usually the name of the units.",
"order":"11",
"type":"str"
}
},
"path":"GENERAL/Display.svg",
"updateType":"Partial"
},
"options":{
"color":"#000000",
"colorAbove":"#df2626",
"colorBelow":"#0074c5",
"decimals":0,
"format":"number",
"offset":0,
"rangeMax":10000,
"rangeMin":-10000,
"scale":1,
"text_format":"",
"units":""
}
}

