{
    "metaData":{
        "desc":"The TRND component is used for displaying the signals from the TRND blocks. Simply just set <code>TRND</code> datapoint to any parameter of the TRND block eg. <code>taskname.TRND:u1</code>. All signals will be displayed in the trend. Each signal can be labeled using <code>signals</code> table.",
        "updateType":"Partial",
        "html":true,
        "connections":{
            "TRND":{
                "order":"01",
                "desc":"Set the datapoint to any parameter of the TRND block eg. <code>taskname.TRND:u1</code> to enable reading of all signals.",
                "default":"$T"
            },
            "ViewConfig":{
                "optional":true,
                "order":"02",
                "desc":"If set the graph configuration is loaded from JSON string. If not the ViewConfig is loaded from TRND block. The configuration is loaded once after the page is loaded. The refresh must be done manually from the menu.",
                "default":""
            },
            "reset_by":{
                "optional":true,
                "order":"03",
                "desc":"If non-zero the data from trend are deleted.",
                "default":""
            },
            "hide_by":{
                "optional":true,
                "desc":"If non-zero the component is hidden.",
                "default":""
            },
            "disable_by":{
                "optional":true,
                "desc":"If non-zero the component is disabled and data are no longer updated.",
                "default":""
            }
        },
        "options":{
            "title":{
                "type":"str",
                "order":"01",
                "desc":"Trend title",
                "default":""
            },
            "signals":{
                "desc":"Table of signal labels. Write labels in the same order as you connect the signals to the TRND block.",
                "type":"table",
                "order":"02",
                "columns":{
                    "label":{
                        "type":"str",
                        "order":"01"
                    },
                    "color":{
                        "type":"color",
                        "order":"02"
                    },
                    "visible":{
                        "type":"bool",
                        "order":"03"
                    }
                },
                "default":[]
            },
            "bufferSize":{
                "type":"number",
                "order":"03",
                "desc":"The size of the buffer in the client web browser. If <code>-1</code> the target TRND block buffer size is used.<br /><i>Note: if the buffer is larger than the buffer on the device the history is lost when the page is refreshed.</i><br /><i>Note: Large buffer can slow your device especially on slower CPUs like RaspberryPi</i>",
                "default":-1
            },
            "defaultRange":{
                "type":"float",
                "order":"03",
                "desc":"The default time range on the time axis in seconds",
                "default":-1
            },
            "refreshRate":{
                "type":"number",
                "order":"04",
                "min":50,
                "desc":"Custom refresh rate of the trend. Normally the trend is refreshed with the HMI main refresh rate period. If needed each trend can have custom one.",
                "default":-1
            },
            "hideLegend":{
                "type":"bool",
                "order":"05",
                "desc":"Hide the legend of the graph.",
                "default":"False"
            },
            "hideRangeSelector":{
                "type":"bool",
                "order":"06",
                "desc":"Hide the range selector bellow the graph.",
                "default":"False"
            },
            "yAxis":{
                "desc":"Table of basic parameters for Y axis. Only first row is used!",
                "type":"table",
                "order":"07",
                "columns":{
                    "type":{
                        "type":"enum",
                        "order":"01",
                        "values":[
                            "linear",
                            "logarithmic"
                        ]
                    },
                    "min":{
                        "type":"float",
                        "order":"02"
                    },
                    "max":{
                        "type":"float",
                        "order":"03"
                    }
                },
                "default":[
                    {
                        "type":"linear",
                        "min":null,
                        "max":null
                    }
                ]
            },
            "dygraphOptions":{
                "order":"08",
                "type":"object",
                "desc":"Custom options for Dygraph library. See http://dygraphs.com/options.html for more info.",
                "default":{}
            }
        },
        "path":"GENERAL/TRND.svg"
    },
    "connections":{
        "TRND":"$T",
        "ViewConfig":"",
        "reset_by":"",
        "hide_by":"",
        "disable_by":""
    },
    "options":{
        "title":"",
        "signals":[],
        "bufferSize":-1,
        "defaultRange":-1,
        "refreshRate":-1,
        "hideLegend":"False",
        "hideRangeSelector":"False",
        "yAxis":[
            {
                "type":"linear",
                "min":null,
                "max":null
            }
        ],
        "dygraphOptions":{}
    }
}

